import React, { Component } from "react";
import Input from "/input.jsx";
class ScraperForm extends Component {
  state = {};

  handleSubmit = e => {
    e.preventDefault();

    //   Call the server
    console.log("submitted");
  };

  temp = e => {
    console.log("ay");
  };

  render() {
    return (
      <div>
        <h1>Create job</h1>
        <form onSubmit={this.handleSubmit}>
          <Input
            name="jobTitle"
            label="Job Title"
            value="ayo"
            onChange={this.temp}
          />
          <Input name="skill" label="Skill" value="ayo" onChange={this.temp} />
          <button className="btn btn-primary">Create task</button>
        </form>
      </div>
    );
  }
}

export default ScraperForm;
